import React from "react";
import "./About.css"
import Navbar from "./Navbar";

const Franchise = () => {
    return ( <>
        <Navbar />

        <div className="about-container">
            <diiv className="about-body">
                <p>Franchise with us</p>
                <p>Join us in expanding Sage Cafe and Grill through franchising opportunities. 
                    With prime locations available in Rawalpindi and Lahore, passionate investors can seize this lucrative opportunity. 
                    Backed by our proven model and support, let's build a legacy of flavor and prosperity together. Contact us to explore 
                    owning a Sage Cafe and Grill franchise.
                </p>
            </diiv>
        </div>
    </> );
}

export default Franchise;
